import Navbar from "./components/Navbar" ;
import Home from "./components/Home";
import Project from"./components/Projects"
import  Footer from "./components/Footer";
import Howitworks from "./components/Howitworks";

import "./App.css";
const App = () => {
  return (
    <>
    <Navbar />
    <Home />
    <Howitworks/>
    <Project/>

    <Footer/>
    </>
  );
}

export default App
